import React from 'react';

const TableItems = ({titles, resultData, rateArr}) => {
  const one = Math.min.apply(id, rateArr.RUB_USD)
  const two = Math.min.apply(null, rateArr.RUB_EUR)
  const three = Math.min.apply(null, rateArr.EUR_USD)
  console.log(one, 'min1')
  console.log(two, 'min2')
  console.log(three, 'min3')

  console.log(one === (Math.min.apply(null, rateArr.RUB_USD)), 'check')


  return (
    <table border='1' bgcolor='#f5deb3' className='table-items'>

      {titles.map((title) =>
        <th className='table-th'  title={title} key={title.id}>
          {title.title}
        </th>
        )}
      <tr className='table-tr'>
        <td className='table-td'>RUB/CUPCAKE</td>
        {resultData.rub.map((rate) =>
          <th className='table-th'  title={rate} key={rate.id}>
            {rate}
          </th>
        )}
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>USD/CUPCAKE</td>
        {resultData.usd.map((rate) =>
          <th className='table-th' title={rate} key={rate.id}>
            {rate}
          </th>
        )}
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>EUR/CUPCAKE</td>
        {resultData.eur.map((rate) =>
          <th className='table-th' rate={rate} key={rate.id}>
            {rate}
          </th>
        )}
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>RUB/USD</td>
        {rateArr.RUB_USD.map((rate, id) =>
          <th
            className={"table-th " + (rateArr.RUB_USD. id !== Math.min.apply(null, rateArr.RUB_USD) ? "marked" : "")}
            rate={rate}
            key={rate.id}
          >
            {rate}
          </th>
        )}
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>RUB/EUR</td>
        {rateArr.RUB_EUR.map((rate) =>
          <th className='table-th' rate={rate} key={rate.id}>
            {rate}
          </th>
        )}
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>EUR/USD</td>
        {rateArr.EUR_USD.map((rate) =>
          <th className='table-th' rate={rate} key={rate.id}>
            {rate}
          </th>
        )}
      </tr>
    </table>
  );
};

export default TableItems;
